export const getdataAction = (data) => {
  return (dispatch,getState)=>{
  

      try {
        const response =  axios.get(data);
        dispatch(getdataAction( response.data))
  
      } catch (error) {
        console.error(error);
      }
    }
  
  return {
    type: "getdata",
    payload: data
  };
};
